	add("hellebore", "{\"term\":\"hellebore\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027ellebore\u0027 from Old french (842-ca. 1400) \u0027ellebre\u0027 \u0027elebore\u0027 from \u0027eleborus\u0027 via Latin from Ancient greek (to 1453) \u0027ἑλλέβορος\u0027 The initial \u0027h\u0027 was restored in English to reflect the Ancient Greek etymology.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the common garden flowering plants of the genus \u0027Helleborus\u0027, in family Ranunculaceae, having supposed medicinal properties\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1811\u0027\u0027, Theodric Romeyn Beck, \u0027An Inaugural Dissertation on Insanity\u0027, [https://books.google.com.au/books?id\u003d5Eg_AAAAYAAJ\u0026amp;pg\u003dPA29\u0026amp;dq\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dknVZVcmoF6HGmAWmqoCABw\u0026amp;ved\u003d0CNMBEOgBMC\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;f\u003dfalse page 29\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Aretæus recommends moderate venæsection to be repeated, if the patient is plethoric, purging with black \u0027\u0027hellebore\u0027\u0027, and in some cases emetics; nourishing diet\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Plinio Prioreschi, \u0027A History of Medicine\u0027, Volume III: Roman Medicine, [https://books.google.com.au/books?id\u003dH3ZaIYAaOSQC\u0026amp;pg\u003dPA122\u0026amp;dq\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dknVZVcmoF6HGmAWmqoCABw\u0026amp;ved\u003d0CJABEOgBMB\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;f\u003dfalse page 122\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Then the physician would use the king of remedies, the powerful one, \u0027\u0027hellebore\u0027\u0027:We suspect that after a sufficient number of administrations of \u0027\u0027hellebore\u0027\u0027 the patient, if he had not done so before, would declare himself cured\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Janet Lembke, \u0027From Grass to Gardens: How to Reap Bounty from a Small Yard\u0027, [https://books.google.com.au/books?id\u003dan6TnsAzW9wC\u0026amp;pg\u003dPA189\u0026amp;dq\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dknVZVcmoF6HGmAWmqoCABw\u0026amp;ved\u003d0CMEBEOgBMB\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;f\u003dfalse page 189\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"It\u0027s Virgil who sends me to the \u0027\u0027hellebores\u0027\u0027. He mentions them as a component of an ointment to be applied to sheep suffering from skin diseases. The ointment comprises “olive oil lees mixed with silver slag, sulphur, pitch from Mount Ida, wax rich in oil, sea-squill, as well, and strong \u0027\u0027hellebore\u0027\u0027 and black bitumen\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A toxic extract of certain s ( or ), formerly used as a pesticide\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1915\u0027\u0027 July 14, Leland Ossian Howard, Robert Harris Hutchison, \u0027House Flies\u0027, US Department of Agriculture, Farmers\u0027 Bulletin No. 679, [https://books.google.com.au/books?id\u003dsQEoAAAAYAAJ\u0026amp;pg\u003dPA15\u0026amp;dq\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dknVZVcmoF6HGmAWmqoCABw\u0026amp;ved\u003d0CLQBEOgBMB\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;f\u003dfalse page 15\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Of the numerous substances tried, the one which seems best to fulfill these conditions is powdered \u0027\u0027hellebore\u0027\u0027. Some of the powdered \u0027\u0027hellebore\u0027\u0027 in use is prepared from the roots of a plant which botanists know as \u0027Veratrum viride\u0027, and which is popularly known as Indian polk or itch weed\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Jeff Gillman, \u0027The Truth About Garden Remedies: What Works, What Doesn\u0027t, and Why\u0027, [https://books.google.com.au/books?id\u003daEHoKAFRN6YC\u0026amp;pg\u003dPA110\u0026amp;dq\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dknVZVcmoF6HGmAWmqoCABw\u0026amp;ved\u003d0CJ8BEOgBMB\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22hellebore%22%7C%22hellebores%22\u0026amp;f\u003dfalse page 110\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Hellebore\u0027\u0027 is a classic insecticide that has not found much favor in today\u0027s pest-control recommendations, though it was certainly effective for its time. In some organic pest-control books information on \u0027\u0027hellebore\u0027\u0027 can still be found, but by and large its use went out of favor in the 1920s and 1930s\", \"priority\":17}]}, \"synonyms\":{}}");

